import React from "react";

const WriteMe = () => {
  return (
    <section className="write-me">
      <div className="write-me__container-small">
        <div className="write-me__wrapper">
          <div className="write-me__top">
            <img
              src={blueRing50}
              alt=""
              className="reviews__decor reviews__decor-blue anim-circle-type1"
            />
            <img
              src={orangeRing50}
              alt=""
              className="reviews__decor reviews__decor-orange anim-circle-type2"
            />
            <img
              src={greenRing50}
              alt=""
              className="reviews__decor reviews__decor-green anim-circle-type3"
            />

            <h1 className="write-me__title">
              let's turn your dream into reality
            </h1>
          </div>
        </div>
      </div>
    </section>
  );
};

export default WriteMe;
